import React from 'react';
import './App.css';
import { BrowserRouter as Router, Switch, Route, Routes } from'react-router-dom';
import { Redirect } from 'react-router';

import './index.css'
import * as ReactBootStrap from "react-bootstrap";
import Radiobutton from './components/Radiobutton';
import Navbar from './components/Navbar';
// import Table from './components/Table';
// import TestingNavbar from './components/TestingNavbar';
import Footer from './components/Footer';

import Header from './components/Header';
import Dropdownbox from './components/Dropdownbox';
import Sql2022 from './Sql2022';
import Sql2021 from './Sql2021';

// // import Selectbox from './Testing';



function App() {
  return (
<Router>

<Header/>

      <Routes>
        <Route exact path="/" element={<Radiobutton/>} />
        <Route exact path="/Dropdownbox" element={<Dropdownbox/>} />
        <Route path="./Sql2022" element={<Sql2022/>} />
        <Route  path="./Sql2021" element={<Sql2021/>} />


      </Routes>
<Dropdownbox/>

<Footer/> 

{/* <Navbar/>

<Radiobutton/>

<Dropdownbox/>

<Table/> */}

{/* <Footer/> */}

{/* <Routes>
<Route path="/" element ={<Radiobutton/>} >
  <Route path="/Home" element ={<Home/>} />
</Route>
</Routes> */}

    {/* <Dropdownbox/>  */}

</Router>


    );


}

export default App;



























































